data:
  definition: ensemble des moyens permettant de transmettre des signaux numériques
    de débit numérique spécifié, sauf indication contraire dans les deux sens, entre
    deux répartiteurs numériques consécutifs ou des points équivalents
  examples: []
  notes:
  - Une section numérique peut être qualifiée pour indiquer son débit numérique ou
    son ordre de multiplexage.
